import React, { useState } from "react";



const Contact = () =>{
    const [data, setData] = useState({
        fullname: "",
        phone: "",
        email: "",
        message: "",
    });

    const InputEvent = (event) =>{
       const {name, value } = event.target;
       setData((preVal) => {
           return {
               ...preVal,
           [name]: value,
           }
       })
    }
    const formSubmit = () =>{};

    return(
        <>
        <div className="my-5">
            <h1 className="text-center">Contact Us</h1>
        </div>
        <div className="container contact_div">
            <div className="row">
                <div className="col-md-6 col-10 mx-auto">
                    <form>
                    <form onSubmit={formSubmit}>
                        <div class="mb-3">
                            <label for="exampleInputEmail1" class="form-label">Full Name</label>
                            <input type="email" class="form-control" id="exampleInputEmail1" name="fullname" value={data.fullname} onChange={InputEvent} placeholder="Enter your Name" />
                        </div>
                        <div class="mb-3">
                            <label for="exampleInputEmail1" class="form-label">Phone</label>
                            <input type="email" class="form-control" id="exampleInputEmail1" name="phone" value={data.phone} onChange={InputEvent} placeholder="Enter your Contact Number" />
                        </div>
                        <div class="mb-3">
                            <label for="exampleInputEmail1" class="form-label">Email address</label>
                            <input type="email" class="form-control" id="exampleInputEmail1" name="email" value={data.email} onChange={InputEvent} placeholder="Enter your Email" />
                        </div>
                        <div class="mb-3">
                            <label for="exampleInputEmail1" class="form-label">Message</label>
                            <textarea type="email" class="form-control" id="exampleInputEmail1" rows="3" name="message" value={data.message} onChange={InputEvent} />
                        </div>
                        <button type="submit" class="btn btn-primary">Submit</button>
                        </form>
                    </form>
                </div>
            </div>
        </div>
        </>
    )
}
export default Contact;
